Ekyna\Component\Commerce\Supplier\Model\SupplierCarrierInterface:
    supplier_tnt:
        __factory: { '@ekyna_commerce.supplier_carrier.repository::createNew': [] }
        name: TNT

Ekyna\Component\Commerce\Supplier\Model\SupplierInterface:
    supplier_techdata:
        __factory: { '@ekyna_commerce.supplier.repository::createNew': [] }
        name: TechData
        gender: 'mr'
        firstName: <firstName()>
        lastName: <lastName()>
        email: <safeEmail()>
        customerCode: SOME-CODE
        address: <generateAddress(@self)>
        currency: <currencyByCode('EUR')>
        #tax: TODO
        carrier: '@supplier_tnt'

